import { FieldType } from "./deserialization/FieldType";
import JsonDeserializationHelper from "./deserialization/JsonDeserializationHelper";
import Flight from "./Flight";

export default class Guest {
    readonly name : string;
    readonly flightIn : Flight;
    readonly flightOut : Flight;
    readonly roomId : number;

    constructor(name : string, flightIn : Flight, flightOut : Flight, roomId : number) {
        this.name = name;
        this.flightIn = flightIn;
        this.flightOut = flightOut;
        this.roomId = roomId;
    }

    static deserialize = (json : any) => {
        const name = JsonDeserializationHelper.assertField(json, 'name', FieldType.STRING);
        const flightIn = JsonDeserializationHelper.assertField(json, 'flightIn', FieldType.OBJECT(Flight.deserialize));
        const flightOut = JsonDeserializationHelper.assertField(json, 'flightOut', FieldType.OBJECT(Flight.deserialize));
        const roomId = JsonDeserializationHelper.assertField(json, 'roomId', FieldType.NUMBER);

        return new Guest(name, flightIn, flightOut, roomId);
    }
}
